import React,{Component} from "react";
import { NavLink } from "react-router-dom";
function Navbar(){
    return(
        <div style={{
            display:'flex',
            direction:''
        }}>
            <ul>
                <li>
        <NavLink to="/">Home</NavLink>
        </li>
        <li>
        <NavLink to="/about">About</NavLink>
        </li>
        <li>
        <NavLink to="/contact">Contact</NavLink>
        </li>
        </ul>
        </div>
    );
}
export default Navbar;
